pragma solidity >=0.4.22 <0.9.0;
pragma experimental ABIEncoderV2;

contract Projects {
    struct Project {
        uint id;
        string name;
        string description;
        uint voteCount;
    }

    constructor() public {
        addProject("Vi\xC5\xA0e ko\xC5\xA0eva za sme\xC4\x87e", "");
        addProject("Javni zahodi", "");
        addProject("Coworking prostori", "");
        addProject("Pametna javna rasvjeta", "");
        addProject("Parkovi za pse", "");
        addProject("Vi\xC5\xA0e zelenila", "");
    }
    mapping(uint => Project) public projects;
    uint public projectsCount; //jer ne mozemo iz mappinga dobiti velicinu

    function addProject (string memory _name, string memory _description) private {
        projectsCount++;
        projects[projectsCount] = Project(projectsCount, _name, _description, 0);
    }
    struct Person {
        uint id;
        bool registered;
        bool voted;
    }

    //Project[] public projects;

    mapping(address => Person) people;
    uint256 public peopleCount;

    function getVotedCount() public view returns (uint256 count) {
        for (uint256 i = 0; i < projectsCount; i++) {
            count += projects[i].voteCount;
        }
    }

    function getMostVoted() public view returns (Project memory) {
        uint256 index = 0;
        for (uint256 i = 1; i < projectsCount; i++) {
            if (projects[i].voteCount > projects[index].voteCount) {
                index = i;
            }
        }
        return projects[index];
    }

}
